import React from "react";
import { Helmet } from "react-helmet";

const MetaData = ({ props }) => {
  return (
    <Helmet>
      <h1>{props.title}</h1>
      <title>{`- Aayo`}</title>
    </Helmet>
  );
};

export default MetaData;
